package Patterns;

public class ContinouesIntegerPattern {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
int rows =5;
int k=11;

for (int i=1; i<=rows; i++) {
	for (int j=1; j<=rows; j++){
		System.out.print(k+" ");
		k++; 
			}
			System.out.println();
		}
	}

}
